  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consist of true color orthophotos
  for Beaver, Bull Shoals, Milwood, Dequeen, Dierks, Gillham, and Norfork Lakes in
  Arkansas and Missouri.These orthophotos where processed using ground control targets,
  airborne GPS and IMU navigation information. The final tiles have a ground resolution
  of 1-foot per pixel. Tile size is 2500 meters by 2500 meters. Image acquisition
  and processing was done by 3001, Inc. under contract for the USCOE Little Rock District
  W9127S-07-D-6001 Task Order No. 0002.\",\n\t\"license_title\": null,\n\t\"extras\":
